import React, { useState } from "react";
import { motion } from "framer-motion";
import { FiX } from "react-icons/fi";
import "../styles/main.css";
import "../styles/responsive.css";
import "../styles/gallery.css";
import { photos, photoCategories } from "../data/galleryData";
import CameraMetadata from "../components/CameraMetadata";

const Gallery = () => {
  const [selectedImage, setSelectedImage] = useState(null);
  const [activeCategory, setActiveCategory] = useState("all");

  const filteredPhotos =
    activeCategory === "all"
      ? photos
      : photos.filter((photo) => photo.category === activeCategory);

  return (
    <motion.div
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      exit={{ opacity: 0 }}
      className="page-container gallery-page"
    >
      <h1>Photography Gallery</h1>

      <div className="category-filter">
        <button
          onClick={() => setActiveCategory("all")}
          className={activeCategory === "all" ? "active" : ""}
        >
          All
        </button>
        {photoCategories.map((category) => (
          <button
            key={category.id}
            onClick={() => setActiveCategory(category.id)}
            className={activeCategory === category.id ? "active" : ""}
          >
            {category.name}
          </button>
        ))}
      </div>

      <div className="gallery-grid">
        {filteredPhotos.map((photo) => (
          <motion.div
            key={photo.id}
            className="gallery-item"
            whileHover={{ scale: 1.02 }}
            onClick={() => setSelectedImage(photo)}
            layoutId={`photo-${photo.id}`}
          >
            <img src={photo.src} alt={photo.title} loading="lazy" />
            <div className="photo-overlay">
              <h3>{photo.title}</h3>
            </div>
          </motion.div>
        ))}
      </div>

      {selectedImage && (
        <motion.div
          className="image-modal"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          exit={{ opacity: 0 }}
          onClick={() => setSelectedImage(null)}
        >
          <motion.img
            src={selectedImage.src}
            alt={selectedImage.title}
            initial={{ opacity: 0, scale: 0.8 }}
            animate={{ opacity: 1, scale: 1 }}
            exit={{ opacity: 0, scale: 0.8 }}
            transition={{ duration: 0.3 }}
            layoutId={`photo-${selectedImage.id}`}
          />
          <div className="image-info">
            <h2>{selectedImage.title}</h2>
            
            {/* Camera metadata display */}
            <div className="camera-metadata">
              <div className="metadata-section">
                <FiCamera className="metadata-icon" />
                <div className="metadata-content">
                  <p><strong>Camera:</strong> {selectedImage.camera}</p>
                  <p><strong>Lens:</strong> {selectedImage.lens}</p>
                </div>
              </div>
              
              <div className="metadata-section">
                <div className="camera-settings">
                  <div className="setting-item">
                    <span className="setting-label">Aperture:</span>
                    <span className="setting-value">{selectedImage.settings.aperture}</span>
                  </div>
                  <div className="setting-item">
                    <span className="setting-label">Shutter:</span>
                    <span className="setting-value">{selectedImage.settings.shutter}</span>
                  </div>
                  <div className="setting-item">
                    <span className="setting-label">ISO:</span>
                    <span className="setting-value">{selectedImage.settings.iso}</span>
                  </div>
                  <div className="setting-item">
                    <span className="setting-label">Focal Length:</span>
                    <span className="setting-value">{selectedImage.settings.focalLength}</span>
                  </div>
                </div>
              </div>
              
              <div className="metadata-section">
                <FiMapPin className="metadata-icon" />
                <div className="metadata-content">
                  <p><strong>Location:</strong> {selectedImage.location}</p>
                </div>
              </div>
              
              <div className="metadata-section">
                <FiCalendar className="metadata-icon" />
                <div className="metadata-content">
                  <p><strong>Date:</strong> {new Date(selectedImage.date).toLocaleDateString('en-US', { 
                    year: 'numeric', 
                    month: 'long', 
                    day: 'numeric' 
                  })}</p>
                </div>
              </div>
            </div>
            
            <button
              onClick={(e) => {
                e.stopPropagation();
                setSelectedImage(null);
              }}
              className="btn close-btn"
            >
              <FiX /> Close
            </button>
          </div>
        </motion.div>
      )}
    </motion.div>
  );
};

export default Gallery;
